import React, { Component } from 'react';

export default class CreateExercises extends Component {
	constructor(props) {
		super(props);

    	this.state = {
      		username: '',
      		description: '',
      		duration: 0,
      		date: new Date(),
      		users: []
    	}
	}

	onChangeUsername(e) {
		this.setState({
			username: e.target.value
		});
	}

	render() {
		return (
			<div>
				<p>You are on the Create Exercises Component</p>
			</div>
		)
	}
}
